name: UIF
code: complif_default_uif
config: {}
description: UIF
entity: uif
footer: ''
header: ''
html: |
  <!DOCTYPE html>
  <html lang="es">
   <head>
    <meta charset="utf-8"/>
    <meta name="viewport"/>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400&amp;display=swap" rel="stylesheet"/>
    <style>
     @page {
  /* Márgenes de 0 en los costados */
  margin-left: 0;
  margin-right: 0;
  }
  /* forma de etiquet ado generalizada, todos los componentes de este tipo tendran estos estilos */
  body {
  font-family: "Arial", sans-serif;
  line-height: 1.6;
  /* margin: 80px; */
  padding: 0;
  margin: 0;
  color: #333;
  max-width: 100vw;
  }
  /* forma de etiquetado generalizada compuesta, todos los componentes h1 dentro del header tendran estos estilos, los h1 por fuera del header no los tendran */
  header h1 {
  margin: 0;
  font-size: 2em;
  color: #555;
  }
  #myImage {
  height: 80px;
  width: 110px;
  object-fit: contain;
  }
  /* forma de aplicar estos estilos a todos los componentes que tengan esta clase */
  .header {
  background-color: black;
  padding: 18px 24px;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  margin-bottom: 100px !important;
  }
  /* forma para modificar un solo componente en especifico */
  #white_text {
  color: white;
  margin-right: 5px;
  font-size: 14px;
  }
  .container {
  height: 100%;
  max-width: 100vw;
  padding: 0 20px;
  box-sizing: border-box;
  }
  .information_header_container {
  background-color: #efeff0;
  padding: 8px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  }
  .section_title {
  font-size: 18px;
  font-weight: 600;
  }
  .section_sub_title {
  color: #4674a0;
  font-weight: 600;
  margin-top: 8px;
  font-size: 18px;
  margin-bottom: 8px;
  }
  .section_information {
  display: flex;
  }
  .section_information_column {
  width: 50%;
  display: flex;
  flex-direction: column;
  }
  .information_container {
  padding: 16px 8px;
  }
  .information_title {
  width: 50%;
  font-weight: 600;
  }
  .information_value {
  width: 50%;
  }
  .divider {
  width: 100%;
  background-color: #cacace;
  height: 0.5px;
  margin: 15px 0;
  }
  table {
  width: 100%;
  border-collapse: collapse;
  margin: 40px auto;
  border: 1px solid #ddd;
  max-width: 95vw;
  box-sizing: border-box;
  }
  .last_modifications {
  display: flex;
  justify-content: space-between;
  width: 85%;
  }
  .debts_container {
  display: flex;
  justify-content: space-between;
  padding: 18px 8px;
  width: 60%;
  }
  th {
  background-color: #f2f2f2 !important;
  padding: 10px;
  text-align: left;
  border-right: 2px solid #ddd;
  border-bottom: 1px solid #ddd;
  }
  td {
  padding: 10px;
  text-align: left;
  border-bottom: 1px solid #ddd;
  /* Línea entre filas */
  }
  .tabla-con-fondo td:first-child,
  .tabla-con-fondo th:first-child {
  background-color: #fafafa;
  }
  th:last-child {
  border-right: none;
  /* Elimina la línea en la última columna */
  }
  /* @ckeditor/ckeditor5-page-break/theme/pagebreak.css */
  .page-break {
  position: relative;
  clear: both;
  display: flex;
  align-items: center;
  justify-content: center;
  }
  .execution_container {
  display: flex;
  }
  .execution_info_container {
  width: 100%;
  display: flex;
  justify-content: space-between;
  margin-left: 30px;
  }
  .image_container {
  display: flex;
  align-items: center;
  }
  .execution_title {
  font-size: 15px;
  font-weight: bold;
  }
  .execution_info {
  width: 50%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  }
  .error_container {
  display: flex;
  }
  .error_text {
  color: #c8341e;
  margin-right: 15px;
  }
  .error {
  color: #c8341e;
  }
  .data_not_found {
  width: 100%;
  display: flex;
  justify-content: center;
  color: #c8341e;
  }
    </style>
   </head>
   <body>
    <main>
     <div class="container">
      <div class="information_header_container">
       <div class="section_title">
        Ejecución
       </div>
      </div>
      <div class="information_container">
       <div class="execution_container">
        <div class="image_container">
         <img alt="Your SVG Image" id="myImage" src="data:image/png;base64,"/>
        </div>
        <div class="execution_info_container">
         <div class="execution_info">
          <div class="execution_title">
           Tipo de Ejecución
          </div>
          <div>
           Unidad de Información Financiera
          </div>
         </div>
         <div class="execution_info">
          <div class="execution_title">
           Fecha de Ejecución
          </div>
          <div>
           {{formatDate fecha "YYYY-MM-DD"}}
          </div>
         </div>
        </div>
       </div>
      </div>
      <div class="information_header_container">
       <div class="section_title">
        Resultado
       </div>
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Datos Enviados
       </div>
       <div class="section_information">
        <div class="section_information_column">
         <div class="information_title">
          CUIT
         </div>
         <div class="information_value">
          {{cuit}}
         </div>
        </div>
       </div>
      </div>
      <div class="divider">
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Respuesta
       </div>
       {{#if responses}}
       <table>
        <thead>
         <tr>
          <th style="width: 120px;">
           Fecha
          </th>
          <th>
           Tipo de Sujeto
          </th>
          <th>
           Estado
          </th>
          <th>
           Mensaje
          </th>
         </tr>
        </thead>
        <tbody>
         {{#each responses}}
         <tr>
          <td>
           {{formatDate fechaCreacion "YYYY-MM-DD"}}
          </td>
          <td>
           {{tipoSujeto}}
          </td>
          <td>
           {{estado}}
          </td>
          <td>
           {{mensaje}}
          </td>
         </tr>
         {{/each}}
        </tbody>
       </table>
       {{else}}
       <div style="font-weight: 600;">
        El número de CUIT/CUIL {{cuit}}  consultado NO se encuentra registrado en la Unidad de Información Financiera.
       </div>
       {{/if}}
      </div>
     </div>
    </main>
   </body>
  </html>
